    d->arg[7] = d->dx;
    d->arg[8] = d->dlam;
    d->arg[9] = d->dlam+102;
    d->arg[5] = d->lbdz;
    d->arg[6] = d->ubdz;
    d->arg[2] = d->Jk;
    d->arg[3] = d->lbdz+102;
    d->arg[4] = d->ubdz+102;
    d->res[0] = 0;
    d->res[1] = 0;
    d->res[2] = 0;
    d->res[3] = 0;
